import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axiosInstance from '../axiosConfig';
import { FaUserCircle, FaCog } from 'react-icons/fa';

const Dashboard = () => {
    const [userData, setUserData] = useState(null);
    const [role, setRole] = useState('');
    const [friends, setFriends] = useState([]); // State for friends list
    const [settingsVisible, setSettingsVisible] = useState(false); // State for settings visibility
    const navigate = useNavigate();

    useEffect(() => {
        const fetchUserData = async () => {
            const user = JSON.parse(localStorage.getItem('user'));
            const token = localStorage.getItem('token'); // Retrieve token

            if (user && token) {
                setUserData(user);
                setRole(user.roles[0]);
                await fetchFriends(user.id, token); // Fetch friends with the token
            } else {
                console.error('No user data found, user not authenticated.');
                navigate('/login'); // Redirect to login if not authenticated
            }
        };

        fetchUserData();
    }, [navigate]);

    // Function to fetch friends list
    const fetchFriends = async (userId, token) => {
        try {
            const response = await axiosInstance.get(`/user/friends/${userId}`, {
                headers: {
                    Authorization: `Bearer ${token}`, // Pass the token in the request header
                },
            });
            console.log('Friends fetched:', response.data); // Log friends data
            setFriends(response.data); // Set friends data
        } catch (error) {
            console.error('Failed to fetch friends:', error.response ? error.response.data : error.message);
        }
    };

    const goToProfile = () => {
        navigate('/profile'); // Navigate to profile page
    };

    // Handle logout
    const handleLogout = () => {
        localStorage.removeItem('user'); // Remove user from local storage
        localStorage.removeItem('token'); // Remove token from local storage
        navigate('/login'); // Navigate to login page
    };

    // Handle update profile
    const handleUpdateProfile = () => {
        navigate('/update-profile'); // Navigate to update profile page
    };

    // Handle delete account
    const handleDeleteAccount = async () => {
        const token = localStorage.getItem('token'); // Retrieve token
        if (userData && token) {
            try {
                await axiosInstance.delete(`/api/user/id/${userData.id}`, {
                    headers: {
                        Authorization: `Bearer ${token}`, // Pass the token in the request header
                    },
                });
                handleLogout(); // Logout after account deletion
            } catch (error) {
                console.error('Failed to delete account:', error.response ? error.response.data : error.message);
            }
        }
    };

    const toggleSettings = () => {
        setSettingsVisible(!settingsVisible); // Toggle settings visibility
    };

    return (
        <div style={{ display: 'flex' }}>
            <div style={{ width: '200px', borderRight: '1px solid #ccc', padding: '10px' }}>
                <FaUserCircle size={50} onClick={goToProfile} style={{ cursor: 'pointer' }} />
                <h3>{userData ? `${userData.username}` : 'Guest'}</h3>
                <h4>Friends List</h4>
                <ul style={{ listStyleType: 'none', padding: 0 }}>
                    {friends.length > 0 ? (
                        friends.map((friend) => (
                            <li key={friend.id}>{friend.firstname} {friend.lastname}</li>
                        ))
                    ) : (
                        <li>No friends found.</li>
                    )}
                </ul>
                <FaCog 
                    size={20} 
                    onClick={toggleSettings} 
                    style={{ cursor: 'pointer', marginTop: '10px' }} 
                />
                {settingsVisible && (
                    <div style={{ marginTop: '10px' }}>
                        <button onClick={handleUpdateProfile}>Update Profile</button>
                        <button onClick={handleDeleteAccount}>Delete Account</button>
                        <button onClick={handleLogout}>Logout</button>
                    </div>
                )}
            </div>
            <div style={{ padding: '20px' }}>
                <h2>{role === 'ROLE_ADMIN' ? 'Admin Dashboard' : 'User Dashboard'}</h2>
                {userData && (
                    <div>
                        <p>Username: {userData.username}</p>
                        <p>Email: {userData.email}</p>
                        <p>Full Name: {userData.firstname} {userData.lastname}</p>
                    </div>
                )}
            </div>
        </div>
    );
};

export default Dashboard;
